    return {
      user: {
        name: 'John',
        lastname: 'Do'
      }
    }
  }

  constructor(props) {
    super(props);
    console.log(props);
  }

  render() {

    return (
      <Fragment>
        <DeskTopLayout>
          <h1>Hello Cali</h1>
          <button onClick={() => Router.push("/about")}>關於卡利</button>
          <button onClick={() => Router.push("/online_baccarat")}>Go to online Baccarat</button>
        </DeskTopLayout>
      </Fragment>

    )
  }
}

export default Index
